char *amath_to_mathml(char *text)
{
	char *result = "";

	if(strlen(text) > 0) {
		input = text;
		yycontext yy;
		memset(&yy, 0, sizeof(yy));
		while (yyparse(&yy));
		result = yy.result;
		yyrelease(&yy);
	}

	return result;
}

